  export const MintProxyMint = Object.assign(
    function (settingsPolicy:string) {return cborToScript(applyParamsToScript("", [settingsPolicy], {"dataType":"list","items":[{"dataType":"bytes"}]} as any), "PlutusV2");},
    
    {_r: {"title":"Data","description":"Any Plutus data."}},
  ) as unknown as MintProxyMint;

